tables.table_schema:
CREATE TABLE RiskMetrics (
  id INT PRIMARY KEY,
  symbol VARCHAR(50),
  timestamp TIMESTAMP,
  volatility DECIMAL(10,2)
);

CREATE TABLE PerformanceMetrics (
  id INT PRIMARY KEY,
  symbol VARCHAR(50),
  return DECIMAL(10,2),
  sharpe_ratio DECIMAL(10,2),
  benchmark_return DECIMAL(10,2)
);

CREATE TABLE risk_metrics (
	risk_id INT PRIMARY KEY,
	symbol VARCHAR(255),
	risk_value DECIMAL(10,2),
	timestamp TIMESTAMP
);

CREATE TABLE trading_strategies (
	strategy_id INT PRIMARY KEY,
	symbol VARCHAR(255),
	strategy_name VARCHAR(255),
	strategy_description TEXT
);

CREATE TABLE RiskMetrics (
   id INT PRIMARY KEY,
   timestamp TIMESTAMP,
   metric_name VARCHAR(50),
   metric_value FLOAT
);

CREATE TABLE TradingAlgorithms (
   algorithm_id INT PRIMARY KEY,
   algorithm_name VARCHAR(50),
   algorithm_type VARCHAR(50),
   implementation_details TEXT
);

CREATE TABLE TradedInstruments (
   instrument_id INT PRIMARY KEY,
   instrument_name VARCHAR(50),
   exchange_name VARCHAR(50),
   sector VARCHAR(50)
);
